import { GetIcon } from "./GetIcon";

function CharacterCard({ card }) {
  return (
    <>
      <img src={card.image} alt={card.name} />
      <p>Nombre:{card.name}</p>{" "}
      <p>
        Especie:
        <GetIcon species={card.species} />
      </p>
      <p>Status: {card.status}</p>
    </>
  );
}
export { CharacterCard };
